package com.helloworks.spring.offieceRoom.model.vo;

public class SearchEmployee {

	private String allType;
	private String deptType;
	private String empNoType;
	private String empNameType;
	private String ePhoneType;
	private String emailType;
	private String deptTypeOption;
	
	public SearchEmployee() {
		// TODO Auto-generated constructor stub
	}

	public String getAllType() {
		return allType;
	}

	public void setAllType(String allType) {
		this.allType = allType;
	}

	public String getDeptType() {
		return deptType;
	}

	public void setDeptType(String deptType) {
		this.deptType = deptType;
	}

	public String getEmpNoType() {
		return empNoType;
	}

	public void setEmpNoType(String empNoType) {
		this.empNoType = empNoType;
	}

	public String getEmpNameType() {
		return empNameType;
	}

	public void setEmpNameType(String empNameType) {
		this.empNameType = empNameType;
	}

	public String getePhoneType() {
		return ePhoneType;
	}

	public void setePhoneType(String ePhoneType) {
		this.ePhoneType = ePhoneType;
	}

	public String getEmailType() {
		return emailType;
	}

	public void setEmailType(String emailType) {
		this.emailType = emailType;
	}

	public String getDeptTypeOption() {
		return deptTypeOption;
	}

	public void setDeptTypeOption(String deptTypeOption) {
		this.deptTypeOption = deptTypeOption;
	}
	
}
